import Link from 'next/link'
import styled from 'styled-components'

const A = styled.a`
  background: transparent;
  border-radius: 3px;
  border: 2px solid #000;
  margin: 0 1em;
  padding: 0.25em 1em;
  tran

  &:hover {
    background-color: #000;
    color: #fff; 
    opacity: 0.8;
  }
`

export default function Header() {
  return (
    <div>
      <Link href="/">
        <A>Latest posts</A>
      </Link>
      <Link href="/posts/new">
        <A>New post</A>
      </Link>
    </div>
  )
}
